■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<p><table width="600" border="0" align="center" cellpadding="0" cellspacing="0">  <tr>  <td>  <font color="#009999" size="5"><strong>北欧に自生する野生種ブルーベリーは、こだわりの原料!</strong></font>  </td>  </tr>  </table><br>  <table width="610" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0302/0106al-01.jpg" width="600" height="1016"></div><br></p><p></td>  </tr></table></p><p><table width="610" border="0" align="center" cellpadding="1" cellspacing="0">  <tr>  <td>  製造販売者：株式会社エーエフシー<br>  静岡県静岡市駿河区豊田2丁目4番3号<br><br></p><p>お召し上がり方：健康補助食品として1日2粒を目安に、水などでお召し上がりください。  </td>  </tr>  </table></p><p><table width="610" border="0" align="center" cellpadding="1" cellspacing="0">  <div align='center'>  <img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0302/0106al-03.jpg" width="505" height="535"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0">   <tr>   <td width="600" valign="top" align="left">  <br>  <font size="3">AFCの人気商品でもある従来品のブルーベリー＆ルテインより、さらにパワーアップ!北欧に自生する野生種ブルーベリーのエキスは、その成分を国内分析し、基準をクリアした原料だけを100％使用。さらに、ブルーベリーエキスは20％アップの240mg、ルテインを従来品のなんと6倍、12mgで大幅増量!従来のブルーベリールテインがDHAとβ-カロテンとの嬉しい組合せで登場です。</font>  </td>  </tr>  </table>  </td>  </tr>  </table>  <br>  <!--栄養成分・原材料表ここから-->  <table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF">  <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td>  <td width="75%"><font color="#333333" size="-1">【1粒当たり】 エネルギー:2.62kcal、たんぱく質:0.15g、脂質:0.17g、炭水化物:0.13g、ナトリウム:0～3mg</font></td>  </tr><tr bgcolor="#FFFFFF">  <td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td>  <td width="75%"><font color="#333333" size="-1">ビルベリー抽出物、ゼラチン、DHA含有魚油、食用油脂、マリーゴールド抽出物(ルテイン含有)、グリセリン、乳化剤、β-カロテン、ヘマトコッカス藻色素(アスタキサンチン含有)、レシチン(大豆由来)、酸化防止剤(V.E、V.C)</font></td>  </tr></table>  <br>  <!--栄養成分・原材料表ここまで--></p><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">AFCの人気商品でもある従来品のブルーベリー＆ルテインより、さらにパワーアップ!北欧に自生する野生種ブルーベリーのエキスは、その成分を国内分析し、基準をクリアした原料だけを100％使用。さらに、ブルーベリーエキスは20％アップの240mg、ルテインを従来品のなんと6倍、12mgで大幅増量!従来のブルーベリールテインがDHAとβ-カロテンとの嬉しい組合せで登場です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">300mg×180粒</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：21×12×2cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">94g</font><br><font color="#333333" size="-1">個装重量：94g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：健康食品</font><br><font color="#333333" size="-1">保存方法：高温多湿および直射日光を避け、涼しい所に保存してください。</font><br><font color="#333333" size="-1">賞味期限:製造日より2年</font><br><font color="#333333" size="-1">アルミ袋入り</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
